.highlight.uncovered .region {
  background-color: #EF5350;
  opacity: 0.2;
}
.highlight.covered .region {
  background-color: #8BC34A;
  opacity: 0.2;
}
.line-number.uncovered {
  color: rgba(255, 255, 255, 0.8) !important;
  background-color: #EF5350;
}
.line-number.covered {
  color: rgba(255, 255, 255, 0.8) !important;
  background-color: #8BC34A;
}
